import "./resources/styles/main.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./pages/Home";
import Jobs from "./pages/Jobs";
import Apply from "./pages/Apply";
import CheckStatus from "./pages/CheckStatus";
import Support from "./pages/Support";
import Description from "./pages/Description";
import NewJob from "./pages/admin/NewJob";
import Signup from "./pages/admin/Signup";
import Login from "./pages/admin/Login"
import ApplicationsList from "./pages/admin/ApplicationsList";
import JobList from "./pages/admin/JobList"
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" Component={Home}></Route>
        <Route path="/jobs" Component={Jobs}></Route>
        <Route path="/jobs/desc/:postId" Component={Description}></Route>
        <Route path="/apply" Component={Apply}></Route>
        <Route path="/check-status" Component={CheckStatus}></Route>
        <Route path="/support" Component={Support}></Route>

        {/* Admin Routes */}

        <Route path="/admin/signup" Component={Signup}></Route>
        <Route path="/admin/login" Component={Login}></Route>
        <Route path="/admin/post-a-new-job" Component={NewJob}></Route>
        <Route path="/admin/" Component={ApplicationsList}></Route>
        <Route path="/admin/job-list" Component={JobList}></Route>
        <Route path="/admin/edit-job/:postId" Component={Signup}></Route>


      </Routes>
    </BrowserRouter>
  );
}

export default App;
